const SERVER_ROUTES = {
    HELLO: 'v1/hello',
    CRAWL_PAGE:'v1/crawl_page'
}

export const startCrawl = async({ options }) => {
    return await fetch(SERVER_ROUTES.CRAWL_PAGE, {
        method: 'POST',
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify(options)
    });
}
